import React from 'react';
import './footer.css';

class Footer extends React.Component {
    render () {
        return (
            <footer className="footer-main">
                <div className="footer-copyright">
                    Copyright &copy; 2020 Profferly
                </div>
          </footer>
        )
    }
}

export default Footer;
